window.bookSummaryJSON = "<p>Coral, Daniel, and their friends have their heads in the game. But what happens when the game gets in their heads?&nbsp;</p> <p>Staying alive in Travail is Coral's one shot at a livelihood, but the game's new content threatens to destroy the in-game economy worldwide. When a newly resurrected god starts mind-hacking players and affecting their real world behavior, Coral can't just stand by, even when getting involved may cause more harm than good.&nbsp;</p> <p>Welcome to Travail, where hard play makes fun work!&nbsp;</p> <p><i>Resurrection </i>is the second audiobook in the Travail Online series. Find out whether Coral and Daniel can keep their wits about them long enough to save Travail from the brink of world war and psychological destruction. Start listening today!</p>"; 
